import React, {memo} from 'react';
import styled from 'styled-components';
import {NavLink} from 'react-router-dom';

import Title from '../../components/TitleContainer';
import PageNumber from '../../components/PageNumber';

const IndexContainer = styled.div`
    .contentContainer{
        color:#333333;
        width:100%;
        
        .contentWrap{
            max-width:1200px;
            margin: 0 auto;
            height: auto;


            .popularWrap{
                margin:120px 0 100px;
                border-radius: 10px;

                .title{
                    font-size:30px;
                    height: auto;
                    width:max-content;
                    margin: 0 auto;
                    font-weight: 600;
                }

                .popContent{
                    margin-top:50px;
                    display: flex;
                    width:100%;
                    height:300px;
                    border-radius: 10px;
                    background-color: #f9f9f9;

                    .imgWrap{
                        width:480px;
                        height: auto;
                        background-color: #d9d9d9;
                        border-radius: 10px 0 0 10px;
                    }

                    .textWrap{
                        display: flex;
                        align-items: center;
                        padding-left:54px;

                        .textInner{
                            .tit{
                                font-size:26px;
                                font-weight: 600;
                                margin-bottom:16px;
                            }

                            .txt{
                                font-size:16px;
                                margin-bottom:6px;
                            }

                            .period{
                                color:#959595;
                                margin-bottom:28px;
                            }

                            .countdown{
                                width:350px;
                                height: 100px;
                                background-color: #ffffff;
                                display: flex;
                                align-items: center;
                                justify-content: center;

                                font-size:60px;
                                font-weight: 700;
                            }
                        }
                    }
                }
            }

            .searchWrap{
                margin-top:120px;
                border:1px solid #B3B3B3;
                border-radius: 10px;
                padding:32px 50px;
                color:#333333;
                display: flex;
                align-items: center;
                justify-content: center;

                label{
                    font-size:18px;
                    font-weight: 500;
                    margin-right:20px;
                }

                select, input {
                    border:1px solid #959595;
                    border-radius: 4px;
                    height: 38px;
                    margin-right:40px;
                    padding:0 14px;
                }
                .keySearchWrap{
                    .keySearch{
                        margin-right:0;
                    }
                }
            }

            .listWrap{
            display: flex;
            flex-wrap: wrap;

                .listItem{
                    width:285px;
                    margin-left:20px;
                    border-radius:10px;
                    border:1px solid #D9D9D9;
                    height:330px;
                    margin-bottom:40px;

                    &:first-child{
                        margin-left:0;
                    }

                    &:nth-child(5n){
                        margin-left:0;
                    }

                    .link{
                        .img{
                            width:100%;
                            object-fit: cover;
                        }

                        .textWrap{
                            padding:20px;

                            .title{
                                font-size:20px;
                                font-weight: 600;
                                height: auto;
                                margin-bottom:8px;
                                width:100%;
                                display: block;
                                
                                white-space: nowrap;
                                overflow: hidden;
                                text-overflow: ellipsis;
                            }

                            .subTit{
                                font-size:14px;
                                color:#959595;
                                width:100%;
                                text-overflow: ellipsis;
                                white-space: nowrap;
                                overflow: hidden;

                            }

                            .progWrap{
                                margin-top:16px;
                                display: flex;
                                justify-content: space-between;
                                width:100%;
                                height: auto;
                                align-items: center;

                                .progress{
                                    font-size:12px;
                                    width:50px;
                                    height: 22px;
                                    border-radius:20px;
                                    border:1px solid #34964b;
                                    color:#34964b;
                                    display: flex;
                                    align-items: center;
                                    justify-content: center;

                                    &.end{
                                        background-color:#f5f5f5;
                                        border:0;
                                        color:#959595;

                                    }
                                }

                                .date{
                                    font-size:14px;
                                    color:#959595;
                                }
                            }
                        }
                    }
                }
            }
        }
    }
`;

const index = memo(() => {
    return (
        <IndexContainer>
            <Title title='금전복지' txt='취업 준비생 여러분이 다양한 기술을 부담없이 배울 수 있도록 최선을 다합니다.' />
            <div className='contentContainer'>
                <div className='contentWrap'>
                    <div className='popularWrap'>
                        <h1 className='title'>가장 클릭수가 높은 정책</h1>
                        <NavLink href='#' className='popContent'>
                            <div className='imgWrap'></div>
                            <div className='textWrap'>
                                <div className='textInner'>
                                    <h3 className='tit'>청년월세 특별지원</h3>
                                    <p className='txt'>19세~34세 청년 대상 월 최대 20만원까지, 12개월 간 월세 지원</p>
                                    <p className='period'>신청기간: 2024-02-26 ~ 2025-02-25</p>
                                    <p className='countdown'>24 : 58 : 50</p>
                                </div>
                            </div>
                        </NavLink>
                    </div>
                    <form className='searchWrap'>
                        <div className='regSearchWrap'>
                            <label htmlFor='regionSearch'>지역 검색</label>
                            <select className='regSearch' id='regionSearch' onChange={onRegionSearch}>
                                <option value='전체'>전체</option>
                                <option value='고용노동부'>고용노동부</option>
                                <option value='서울특별시'>서울특별시</option>
                                <option value='인천광역시'>인천광역시</option>
                                <option value='대전광역시'>대전광역시</option>
                                <option value='세종특별자치시'>세종특별자치시</option>
                                <option value='대구광역시'>대구광역시</option>
                                <option value='부산광역시'>부산광역시</option>
                                <option value='광주광역시'>광주광역시</option>
                            </select>
                        </div>
                        <div className='titSearchWrap'>
                            <label htmlFor='titleSearch'>제목 검색</label>
                            <input type='text' id='titleSearch' className='titSearch' ref={titleSearchRef} onChange={onTitleSearch} />
                        </div>
                        <div className='keySearchWrap'>
                            <label htmlFor='keywordSearch'>키워드 검색</label>
